const FollowingUpload = () => {
  const [isExpanded, setIsExpanded] = useState(false);
  const [currentPage, setCurrentPage] = useState(1);

  const toggleExpand = () => {
    setIsExpanded(!isExpanded);
  };

  const followingData = [...followingUploadData.data];

  const itemsPerPage = isExpanded ? 25 : 10;
  const totalPages = Math.ceil(followingData.length / itemsPerPage);

  const collapsedData = followingData.slice(
    (currentPage - 1) * itemsPerPage,
    (currentPage - 1) * itemsPerPage + 10
  );

  const expandedData = followingData.slice(
    (currentPage - 1) * itemsPerPage,
    currentPage * itemsPerPage
  );

  const displayedData = isExpanded ? expandedData : collapsedData;

  const handlePageChange = (page) => {
    if (page > 0 && page <= totalPages) {
      setCurrentPage(page);
    }
  };

  return (
    <FollowingUploadWrapper>
      <FollowingTitle></FollowingTitle>
      <FollowingUploadHeader>
        <TextWrapper>
          <FollowingUploadTitle> </FollowingUploadTitle>
          <FollowingUploadInfo>
                
          </FollowingUploadInfo>
        </TextWrapper>
        <ExpandButton onClick={toggleExpand}>
          <img src={isExpanded ? foldIcon : spreadIcon} alt="toggle button" />
        </ExpandButton>
      </FollowingUploadHeader>
      <CardsContainer isExpanded={isExpanded}>
        {displayedData.map((data, index) => (
          <CardWrapper key={index} index={index} isExpanded={isExpanded}>
            <AudioCard {...data} />
          </CardWrapper>
        ))}
      </CardsContainer>
      {isExpanded && (
        <Pagination>
          <ArrowButton
            onClick={() => handlePageChange(currentPage - 1)}
            disabled={currentPage === 1}
          >
            &lt;
          </ArrowButton>
          {Array.from({ length: totalPages }, (_, index) => (
            <PageNumber
              key={index}
              onClick={() => handlePageChange(index + 1)}
              isActive={currentPage === index + 1}
            >
              {index + 1}
            </PageNumber>
          ))}
          <ArrowButton
            onClick={() => handlePageChange(currentPage + 1)}
            disabled={currentPage === totalPages}
          >
            &gt;
          </ArrowButton>
        </Pagination>
      )}
    </FollowingUploadWrapper>
  );
};

